import bottomRightImage from "./images/rd.png";
import bottomLeftImage from "./images/sd.png";
import topLeftImage from "./images/se.png";
import backgroundImage from "./images/Rectangle.png";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import MoveAnimation from "./MoveAnimation";

function App() {
  const backgroundStyle = {
    backgroundImage: `url(${backgroundImage})`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    width: "100vw",
    height: "100vh",
  };
  const imageVariants = {
    hidden: { y: "100%" },
    visible: { y: "0%" },
    exit: { y: "-100%" },
  };

  return (
    <Router>
      <div>
        <div style={backgroundStyle} className="back"></div>
        <MoveAnimation
          image={
            <img className="fixed-top-left" src={topLeftImage} alt="Top Left" />
          }
          imageVariants={imageVariants}
          imgStyle={{
            bottom: "10vh",
            height: "90vh",
            width: "100vw",
            zIndex: "2",
          }}
          side={true}
        />
        <img
          className="fixed-bottom-left"
          src={bottomLeftImage}
          alt="Bottom Left"
        />
        <img
          className="fixed-bottom-right"
          src={bottomRightImage}
          alt="Bottom Right"
        />
        <Routes>
          <Route path="/" element={<div>home</div>} />
          <Route path="/about" element={<div>about</div>} />
          <Route path="/users" element={<div>users</div>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
